import Boton from './componentes/Boton';
import './App.css';
import { Component } from 'react';

export default class App extends Component{

  constructor(props){
    super(props);
    this.state = {nuevotexto: ''}
  }

  cambiotexto = (nuevotexto) =>{
    this.setState( 
      { texto: nuevotexto }
    );
  }

  render(){ 
const { cambiotexto , nuevotexto } = this.props;

   const textoreal = "nombre del boton1";

  return (
    <div className="App">

       <h3>Este es el componente</h3>
       <Boton texto={textoreal}/> 
       <input type="text" placeholder='Introduce un texto' onChange={cambiotexto(nuevotexto)}/>


    </div>
    );
   }

}
